import React, { useEffect } from 'react';
import queryString from 'query-string';

import './Chat.css'

const Chat = ({location}) => {
  useEffect(() => {
    const data = queryString.parse(location.search);
  }, []);
  return (
    <div>
        <h1>Hello Chat</h1>
    </div>
  )
}

export default Chat;
